import React from "react";

export default function Navbar(){

    function scroll(){
        $(window).scroll(function() {
            if ($(window).scrollTop()) {
                $('nav').addClass('black');
            } else {
                $('nav').removeClass('black');
            }
        })
    }

    return(
        <nav onScroll={scroll}>
           
           <span className="logo">Logo</span>
           <ul>
            <li>Home</li>
            <li>Services</li>
            <li>About</li>
           </ul>
            
        </nav>
    )
}
